4"><div class="post-page my-4"><h1>新竹新豐雙喜樓海鮮餐廳 | 啟昱與怡君 | 文定 | 迎娶 | 宴客</h1><hr><span class="date">2018-05-28</span> <span class="date" id="pageviews">Pageviews: <font class="count">--<font></font></font></span></div><p>這場婚禮讓我充分地感受到新竹人的熱情，周邊鄰里的鄉親人情味，是我從小在台北未曾感受過的</p><p>啟昱和怡君 對爾康來說是很重要的客人～新娘 個性活潑 直爽，新郎超級木訥，</p><p>很特別的是新娘的爸爸是超級的植物控，在家門口種植了許多不同品種的蘭花，</p><p>到現在我都依稀想見到當時他跟我 談 種花經驗 的興奮眼神</p><p>永結同心 既是這場婚宴的背板標語，也是我對 昱與君 最大的祝福 ～ 要幸福唷 ：）</p><p><img src="https://storage.googleapis.com/aircon.tw/2019/08/77f01ae3-20180428_air-1.jpg"></p><p><img src="https://storage.googleapis.com/aircon.tw/2019/08/6ee7b90a-20180428_air-4.jpg"></p><p><img src="https://storage.googleapis.com/aircon.tw/2019/08/6ee7b90a-20180428_air-5.jpg"></p><p><img src="https://storage.googleapis.com/aircon.tw/2019/08/5bc9ac48-20180428_air-6.jpg"></p><p><img src="https://storage.googleapis.com/aircon.tw/2019/08/613ba8d5-20180428_air-8.jpg"></p><p><img src="https://storage.googleapis.com/aircon.tw/2019/08/6e996402-20180428_air-9.jpg"></p><p><img src="https://storage.googleapis.com/aircon.tw/2019/08/fc4c5de7-20180428_air-10.jpg"></p><p><img src="https://storage.googleapis.com/aircon.tw/2019/08/c7f9b44f-20180428_air-11.jpg"></p><p><img src="https://storage.googleapis.com/aircon.tw/2019/08/e485d95a-20180428_air-12.jpg"></p><p><img src="https://storage.googleapis.com/aircon.tw/2019/08/e485d95a-20180428_air-13.jpg"></p><p><img src="https://storage.googleapis.com/aircon.tw/2019/08/e20f6ee2-20180428_air-14.jpg"></p><p><img src="https://storage.googleapis.com/aircon.tw/2019/08/0f9dd8b7-20180428_air-15.jpg"></p><p><img src="https://storage.googleapis.com/aircon.tw/2019/08/f1ec8887-20180428_air-16.jpg"></p><p><img src="https://storage.googleapis.com/aircon.tw/2019/08/0c852c96-20180428_air-17.jpg"></p><p><img src="https://storage.googleapis.com/aircon.tw/2019/08/68f068c4-20180428_air-18.jpg"></p><p><img src="https://storage.googleapis.com/aircon.tw/2019/08/211e703b-20180428_air-19.jpg"></p><p><img src="https://storage.googlea
